import { Link } from 'react-router-dom'

function LandingPage() {
    return (
        <div class="landing-page">
            <h1>studyPal</h1>
            <p>Landing Page</p>
            <div>
                <p><Link to='/login'>Log in</Link></p>
                <p><Link to='/signup'>Sign up</Link></p>
            </div>
        </div>
    )
}

export default LandingPage;
